import React from 'react';
import ScrollableAnchor from 'react-scrollable-anchor';
import ScrollAnimation from 'react-animate-on-scroll';
import { Parallax } from 'react-scroll-parallax';

import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import Box from '@material-ui/core/Box';

import { makeStyles } from '@material-ui/core/styles';
import first from '../../../data/backs/1.svg';
import second from '../../../data/backs/2.svg';

const useStyles = makeStyles((theme) => ({
    shape: {
        zIndex: '-1',
        [theme.breakpoints.down('xs')]: {
            visibility: 'hidden',
        },
        [theme.breakpoints.down('md')]: {
            opacity: '0.4',
        },
    },
}));

const Header = () => {
    const classes = useStyles();

    const firstStyle = {
        position: 'absolute',
        right: 0,
        top: 0,
    };

    const secondStyle = {
        position: 'absolute',
        top: '40%',
        left: 0,
    };

    return (
        <ScrollableAnchor id="header">
            <ScrollAnimation animateIn="fadeIn" animateOnce={true}>
                <Box pt={6} display="flex" justify="center">
                    <Grid container alignItems="center" justify="center" spacing={2}>
                        <Typography variant="h2" component="h1">
                            Mobile
                        </Typography>
                        <Typography variant="subtitle1" component="p" gutterBottom>
                            Above all, we are engineers, and our mission is to find the most elegant and economical
                            solutions to business problems. In our work we use various tools,
                        </Typography>
                        <Button
                            variant="contained"
                            href="#contact"
                            color="primary"
                            disableElevation
                            style={{ marginTop: 25 }}
                        >
                            Start out
                        </Button>
                    </Grid>
                </Box>
            </ScrollAnimation>
        </ScrollableAnchor>
    );
};

const styles = {
    highlighter: {
        backgroundColor: '#FFED4F',
        paddingLeft: 5,
        paddingRight: 5,
    },
};

export default Header;
